import React from 'react';
import { connect } from 'react-redux';

class TransactionHistory extends React.Component {
  render() {
    //console.log(this.props['accounts'])
    return this.props.transaction.filter(x => x.accountId === this.props.accountId).map(info =>(
        <div className="card" key={info.accountId}>
            <div className="card-body">
                <h5 className="card-title">Activity</h5>
            </div>
            <ul className="list-group list-group-flush">
                <li className="list-group-item">{info.activity}, Amount: {info.amount}</li>
            </ul>
        </div>
    ))
    }


}

const mapStateToProps = state => {
    return {
      transaction: state.bankInfo.transaction,
    };
  };
  export default connect(mapStateToProps)(TransactionHistory);
